                xAxisIndex: [0],
                start: this.zoomStart,
                end: this.zoomEnd
                },
                {
                type: 'inside',
                yAxisIndex: [0],
                start: 29,
                end: 36
                }
            ],
            series: [
                {
                    name: '凌晨',
                    type: 'scatter',
                    itemStyle: {
                        normal: {
                        opacity: 0.8
                        // color: function (param) {
                        //     console.log("Pass rate is : ", param.value[1]);
                        //         return getColorForValue(param.value[1] * 100, minVal, maxVal);
                        //     }
                        }
                    },
                    symbolSize: function (val) {
						var level = this.zoomEnd - this.zoomStart;
						console.log(level, "in symbolSize");
                        return Math.sqrt(val[3] / 50) * 20;
                    },
                    data: data1
                },
                {
                    name: '白天',
                    type: 'scatter',
                    itemStyle: {
                        normal: {
                        opacity: 0.8
                        }
                    },
                    symbolSize: function (val) {
                        return Math.sqrt(val[3] / 50) * 10;
                    },
                    data: data2
                },
                {
                    name: '傍晚',
                    type: 'scatter',
                    itemStyle: {
                        normal: {
                        opacity: 0.8
                        }
                    },
                    symbolSize: function (val) {
                        return Math.sqrt(val[3] / 50) * 10;
                    },
                    data: data3
                },
				{
					name: '夜晚',
					type: 'scatter',
					itemStyle: {
						normal: {
						opacity: 0.8
						}
					},
					symbolSize: function (val) {
						return Math.sqrt(val[3] / 50) * 10;
					},
					data: data4
				}
            ]
            };

            option && myChart.setOption(option);
			// myChart.on('dataZoom', (params) => {
            //     this.zoomStart = params.start;
            //     this.zoomEnd = params.end;
            //     myChart.setOption(option);
            // });
            };
            if (document.readyState === 'complete') {   
                draw();
            } else {
                window.onload = draw;
            }
        },
        data_parse() {
            fetch('../../data/q2_zoom_chart.json')
                .then(response => response.json())
                .then(dataload => {
                    console.log("in fetch: ", dataload);
                    this.data = dataload;
                    for (let i = 0; i < this.data.length; i++) {
                        const year = this.data[i][0];
                        const month = this.data[i][1];
                        const day = this.data[i][2];
                        this.data[i].splice(0, 3, `${year}-${month}-${day}`);
                        // this.data[i][0] = new Date(this.data[i][0]);
                    }
                })
                .catch(error => console.error('Error loading data', error));
            
            console.log("in data parse function, ", this.data);
        }
    }

}
